import '../styles/Login.css'

const Login = () => { 

    return ( 
        <div className="container">
            <h1>Login</h1>
            <input id="login-email" type="email" name="login-email" placeholder="Email"/>
            <input id="login-password" type="password" name="login-password" placeholder="Password" />
            <button id="login-forgot-password-btn">Forgot password?</button>
            <div id="login-login-or-create-buttons">
                <button id='login-create-account-btn'>CreateAccount</button>
                <button id="login-login-btn">Login</button>
            </div>
        </div>
     );
}

export default Login;
